// src/pages/SEOAnalyzer.js
import React, { useState, useEffect } from 'react';
import { TrendingUp, CheckCircle, Circle, Zap, BarChart, Globe, Search, Clock, Target } from 'lucide-react';
import openaiService from '../services/openaiService';

const SEOAnalyzer = () => {
  const [url, setUrl] = useState('');
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [trendingData, setTrendingData] = useState(null);
  const [actionItems, setActionItems] = useState([]);

  useEffect(() => {
    const loadData = async () => {
      try {
        // Get real-time trending keywords
        const keywordsData = await openaiService.generateSEOKeywords();
        setTrendingData(keywordsData);
        
        // Get AI action items
        const aiActions = openaiService.getAIActionItems();
        setActionItems(aiActions);
      } catch (error) {
        console.error('Error loading SEO data:', error);
        // Fallback data
        setTrendingData({
          date: new Date().toLocaleDateString('en-GB'),
          keywords: [
            { keyword: 'UK next day delivery', change: 45, volume: 'High' },
            { keyword: 'AI price comparison', change: 32, volume: 'Medium' },
            { keyword: 'secure online payments', change: 28, volume: 'High' }
          ]
        });
        setActionItems([
          { id: 1, task: 'Optimize page titles', priority: 'high', completed: false },
          { id: 2, task: 'Improve page speed', priority: 'high', completed: false }
        ]);
      }
    };

    loadData();
  }, []);

  const handleAnalyze = async (e) => {
    e.preventDefault();
    setLoading(true);
    
    try {
      // Simulate AI analysis
      setTimeout(() => {
        setAnalysis({
          score: 87,
          issues: [
            { id: 1, type: 'critical', message: 'Missing meta descriptions on product pages' },
            { id: 2, type: 'warning', message: 'Images missing alt text' },
            { id: 3, type: 'suggestion', message: 'Add structured data for products' }
          ],
          recommendations: [
            'Implement Accelerated Mobile Pages (AMP)',
            'Add FAQ schema for better rich snippets',
            'Optimize for voice search queries'
          ],
          performance: {
            loadTime: 2.4,
            mobileScore: 85,
            desktopScore: 92
          }
        });
        setLoading(false);
      }, 2000);
    } catch (error) {
      console.error('Analysis error:', error);
      setLoading(false);
    }
  };

  const toggleActionItem = (id) => {
    setActionItems(items => 
      items.map(item => 
        item.id === id ? { ...item, completed: !item.completed } : item
      )
    );
  };

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="mb-8">
        <h1 className="text-4xl font-bold text-gray-900 mb-2">AI SEO Analyzer</h1>
        <p className="text-gray-600 text-lg">Real-time SEO insights powered by artificial intelligence</p>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        {/* Left Column - Analyzer */}
        <div className="lg:col-span-2 space-y-8">
          {/* Analysis Tool */}
          <div className="bg-gradient-to-br from-white to-blue-50 rounded-2xl shadow-xl p-8">
            <div className="flex items-center mb-6">
              <div className="p-3 bg-blue-100 rounded-xl mr-4">
                <Search className="h-6 w-6 text-blue-600" />
              </div>
              <div>
                <h2 className="text-2xl font-bold text-gray-900">Website Analysis</h2>
                <p className="text-gray-600">Get instant SEO insights for any URL</p>
              </div>
            </div>
            
            <form onSubmit={handleAnalyze} className="space-y-6">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-3">
                  Enter URL to analyze
                </label>
                <div className="flex space-x-4">
                  <input
                    type="url"
                    value={url}
                    onChange={(e) => setUrl(e.target.value)}
                    placeholder="https://yourwebsite.com"
                    className="flex-1 border-2 border-gray-200 rounded-xl px-6 py-4 text-lg focus:outline-none focus:border-blue-500 focus:ring-2 focus:ring-blue-200"
                    required
                  />
                  <button
                    type="submit"
                    disabled={loading}
                    className="bg-gradient-to-r from-blue-600 to-purple-600 text-white px-8 py-4 rounded-xl font-semibold hover:from-blue-700 hover:to-purple-700 disabled:opacity-50 flex items-center shadow-lg hover:shadow-xl transition"
                  >
                    {loading ? (
                      <>
                        <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white mr-3"></div>
                        Analyzing...
                      </>
                    ) : (
                      <>
                        <Search className="mr-3 h-5 w-5" />
                        Analyze SEO
                      </>
                    )}
                  </button>
                </div>
              </div>
            </form>

            {analysis && (
              <div className="mt-10 pt-8 border-t border-gray-200">
                <div className="flex items-center justify-between mb-8">
                  <h3 className="text-xl font-bold">Analysis Results</h3>
                  <div className="text-sm text-gray-500">
                    Last updated: {new Date().toLocaleTimeString()}
                  </div>
                </div>
                
                <div className="grid grid-cols-2 md:grid-cols-4 gap-6 mb-8">
                  <div className="bg-gradient-to-br from-green-50 to-green-100 p-6 rounded-2xl">
                    <div className="text-3xl font-bold text-green-700 mb-2">{analysis.score}/100</div>
                    <div className="text-sm font-medium text-green-800">SEO Score</div>
                  </div>
                  <div className="bg-gradient-to-br from-blue-50 to-blue-100 p-6 rounded-2xl">
                    <div className="text-3xl font-bold text-blue-700 mb-2">{analysis.performance.loadTime}s</div>
                    <div className="text-sm font-medium text-blue-800">Load Time</div>
                  </div>
                  <div className="bg-gradient-to-br from-purple-50 to-purple-100 p-6 rounded-2xl">
                    <div className="text-3xl font-bold text-purple-700 mb-2">{analysis.performance.mobileScore}/100</div>
                    <div className="text-sm font-medium text-purple-800">Mobile Score</div>
                  </div>
                  <div className="bg-gradient-to-br from-orange-50 to-orange-100 p-6 rounded-2xl">
                    <div className="text-3xl font-bold text-orange-700 mb-2">{analysis.issues.length}</div>
                    <div className="text-sm font-medium text-orange-800">Issues Found</div>
                  </div>
                </div>
                
                <div className="space-y-6">
                  <div>
                    <h4 className="font-bold text-lg mb-4 flex items-center">
                      <Target className="h-5 w-5 mr-2 text-red-500" />
                      Critical Issues
                    </h4>
                    <div className="space-y-3">
                      {analysis.issues.filter(i => i.type === 'critical').map(issue => (
                        <div key={issue.id} className="flex items-start p-4 bg-red-50 rounded-xl">
                          <div className="flex-shrink-0 mt-1">
                            <div className="h-3 w-3 bg-red-500 rounded-full"></div>
                          </div>
                          <div className="ml-4">
                            <div className="font-medium text-red-800">{issue.message}</div>
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                  
                  <div>
                    <h4 className="font-bold text-lg mb-4 flex items-center">
                      <Zap className="h-5 w-5 mr-2 text-yellow-500" />
                      AI Recommendations
                    </h4>
                    <div className="space-y-3">
                      {analysis.recommendations.map((rec, index) => (
                        <div key={index} className="flex items-center p-4 bg-yellow-50 rounded-xl">
                          <div className="flex-shrink-0 mr-4">
                            <div className="h-8 w-8 bg-yellow-100 rounded-lg flex items-center justify-center">
                              <span className="text-yellow-600 font-bold">{index + 1}</span>
                            </div>
                          </div>
                          <div className="font-medium text-yellow-800">{rec}</div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              </div>
            )}
          </div>

          {/* Action Items */}
          <div className="bg-white rounded-2xl shadow-xl p-8">
            <div className="flex items-center justify-between mb-8">
              <div className="flex items-center">
                <div className="p-3 bg-purple-100 rounded-xl mr-4">
                  <CheckCircle className="h-6 w-6 text-purple-600" />
                </div>
                <div>
                  <h2 className="text-2xl font-bold text-gray-900">AI Action Plan</h2>
                  <p className="text-gray-600">Personalized tasks to improve your SEO</p>
                </div>
              </div>
              <div className="text-sm px-4 py-2 bg-gray-100 rounded-full">
                {actionItems.filter(item => item.completed).length}/{actionItems.length} completed
              </div>
            </div>
            
            <div className="space-y-4">
              {actionItems.map((item) => (
                <div 
                  key={item.id}
                  className={`p-6 rounded-xl border-2 transition-all duration-300 ${
                    item.completed 
                      ? 'border-green-200 bg-green-50' 
                      : 'border-gray-100 hover:border-purple-200 hover:bg-purple-50'
                  }`}
                >
                  <div className="flex items-start">
                    <button
                      onClick={() => toggleActionItem(item.id)}
                      className="mt-1 mr-4"
                    >
                      {item.completed ? (
                        <div className="h-6 w-6 bg-green-500 rounded-full flex items-center justify-center">
                          <CheckCircle className="h-4 w-4 text-white" />
                        </div>
                      ) : (
                        <div className="h-6 w-6 border-2 border-gray-300 rounded-full"></div>
                      )}
                    </button>
                    
                    <div className="flex-1">
                      <div className="flex items-center justify-between mb-2">
                        <span className={`font-medium ${item.completed ? 'line-through text-gray-500' : 'text-gray-900'}`}>
                          {item.task}
                        </span>
                        <span className={`px-3 py-1 rounded-full text-xs font-medium ${
                          item.priority === 'high' ? 'bg-red-100 text-red-800' :
                          item.priority === 'medium' ? 'bg-yellow-100 text-yellow-800' :
                          'bg-blue-100 text-blue-800'
                        }`}>
                          {item.priority}
                        </span>
                      </div>
                      
                      <div className="flex items-center text-sm text-gray-600">
                        <Clock className="h-4 w-4 mr-1" />
                        <span className="mr-4">{item.estimatedTime}</span>
                        <span className="text-green-600 font-medium">{item.impact}</span>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>

        {/* Right Column - Trending Keywords */}
        <div className="space-y-8">
          {/* Trending Keywords */}
          <div className="bg-gradient-to-br from-gray-900 to-gray-800 text-white rounded-2xl shadow-xl p-8">
            <div className="flex items-center mb-6">
              <div className="p-3 bg-gradient-to-r from-blue-500 to-purple-500 rounded-xl mr-4">
                <TrendingUp className="h-6 w-6" />
              </div>
              <div>
                <h2 className="text-2xl font-bold">Live Market Trends</h2>
                <p className="text-gray-300">Updated in real-time</p>
              </div>
            </div>
            
            {trendingData && (
              <>
                <div className="mb-6 p-4 bg-gray-800 rounded-xl">
                  <div className="flex items-center text-sm text-gray-300 mb-2">
                    <Clock className="h-4 w-4 mr-2" />
                    Last updated: {trendingData.date}
                  </div>
                  <div className="text-sm text-blue-300">
                    UK Time: {new Date().toLocaleTimeString('en-GB', { timeZone: 'Europe/London' })}
                  </div>
                </div>
                
                <div className="space-y-4">
                  {trendingData.keywords.map((item, index) => (
                    <div 
                      key={index}
                      className="p-4 bg-gray-800 rounded-xl hover:bg-gray-700 transition"
                    >
                      <div className="flex justify-between items-start mb-2">
                        <span className="font-medium">{item.keyword}</span>
                        <div className="flex items-center">
                          <TrendingUp className="h-4 w-4 text-green-400 mr-1" />
                          <span className="text-green-400 font-bold">+{item.change}%</span>
                        </div>
                      </div>
                      <div className="flex justify-between text-sm">
                        <span className="text-gray-400">Search Volume: {item.volume}</span>
                        <div className="flex items-center">
                          <Zap className="h-3 w-3 text-yellow-400 mr-1" />
                          <span className="text-yellow-400">Trending Now</span>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              </>
            )}
          </div>

          {/* SEO Tips */}
          <div className="bg-white rounded-2xl shadow-xl p-8">
